*{
  -moz-user-select: none; /*火狐*/
  -webkit-user-select: none; /*webkit浏览器*/
  -ms-user-select: none; /*IE10*/
  -khtml-user-select: none; /*早期浏览器*/
  user-select: none;
}
.title{
  margin-bottom: -19px !important;
  padding-bottom: 17px !important;
}
.left {
  min-width: 390px;
  min-height: 550px;
  position: relative;
  padding-left: 40px;
}

.top {
  position: absolute;
  top: 0px;
}

.bottom {
  position: absolute;
  bottom: 0px;
}

.textbot {
  position: absolute;
  bottom: 0px;
  left: 59px;
  width: 100%;
}
.active {
  border: 1px solid #44B549 !important;
  color: #44B549 !important;
}
.li {
  float: left;
  width: 93px;
  line-height: 48px;
  border: 1px solid #E7E7EB;
  background: #FAFAFA;
  text-align: center;
  cursor: pointer;
  color: #999;
  position: relative;
}
.text{
  height: 50px;
  overflow: hidden;
  text-overflow: ellipsis;
  -ms-text-overflow: ellipsis;
  white-space: nowrap;
  padding: 0 5px;
}
.text:hover {
  color: #000;
}

.add {
  position: absolute;
  bottom: 65px;
  width: 100%;
  line-height: 48px;
  border: 1px solid #E7E7EB;
  background: #FAFAFA;
}
.arrow {
  position: absolute;
  bottom: -16px;
  left: 36px;
  /* 圆角的位置需要细心调试哦 */
  width: 0;
  height: 0;
  font-size: 0;
  border: solid 8px;
  border-color:#fff #F4F5F9 #F4F5F9 #F4F5F9;
}
.tianjia {
  position: absolute;
  bottom: 115px;
  width: 100%;
  line-height: 48px;
  background: #FAFAFA;
}
.addadd {
  width: 100%;
  line-height: 48px;
  border: 1px solid #E7E7EB;
  background: #FAFAFA;
  height: 48px;
}
.right {
  background: #fff;
  min-height: 400px;
}
.spwidth{
  width: 100%;
}
